    false,nt"url": null,nt"notes": "Geologic interpretive map showing areas
    of unstable slopes, Kitsap County, Washington, Open File Report 75-7. This map is
    intended for use by Kitsap County to designate potential landslide hazard areas.
    Naturally unstable slopes are potential landslide hazard areas. Potential landslide
    hazard areas present greater-than-normal risk of damage to buildings and injury
    to people. Therefore, plans for development in mapped unstable areas should include
    a geotechnical (engineering geology) on-site investigation which is completed prior
    to County approval of grading and foundation designs.",nt"license_title": null,nt"extras":
